Science Documentary hosted by Simon Armitage, published by National Geographic in 2014 - English narration


Information
------------------------------

Generation Astronaut
Generation Astronaut is a groundbreaking documentary special that sees ordinary men and women from across the globe competing against each other for the chance to live the dreams of a generation Following more than 100 winners from over 60 countries as they strive to win one of 23 tickets to space aboard the Lynx shuttle in 2015, Generation Astronaut showcases a week of intense competition at the Kennedy Space Center in Florida, under the tutelage of a judging panel including legendary astronaut, Buzz Aldrin. This programme follows the hopes and dreams of the recruits as they bid to earn the journey of a lifetime - and make history

